import React, { useState } from 'react';
import './ContactUs.css';

const WeddingPlanningForm = () => {
    const [step, setStep] = useState(1); // Track the current step of the form
    const [formData, setFormData] = useState({
        eventType: '',
        weddingTheme: {
            themePreference: '',
            colorScheme: '',
            decorStyle: '',
        },
        venueDetails: {
            type: '',
            size: '',
            specialRequirements: '',
        },
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleNext = () => {
        setStep(step + 1);
    };

    const handlePrev = () => {
        setStep(step - 1);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(formData);
    };

    return (
        <div className="wedding-planning-form">
            <h2>Wedding Planning Form</h2>
            <form onSubmit={handleSubmit}>
                {/* Step 1: Basic Details */}
                {step === 1 && (
                    <section className="form-section">
                        <h3>Let us start by getting some information about you</h3>
                        <select
                            name="eventType"
                            value={formData.eventType}
                            onChange={handleChange}
                        >
                            <option value="">Select Event Type</option>
                            <option value="Traditional">Traditional</option>
                            <option value="Modern">Modern</option>
                            <option value="Destination">Destination</option>
                        </select>
                    </section>
                )}

                {/* Step 2: Wedding Theme and Style (Dynamic based on eventType) */}
                {step === 2 && formData.eventType && (
                    <section className="form-section">
                        <h3>Wedding Theme and Style</h3>
                        {formData.eventType === 'Traditional' && (
                            <div>
                                <label>Traditional Theme Preference</label>
                                <select
                                    name="weddingTheme.themePreference"
                                    value={formData.weddingTheme.themePreference}
                                    onChange={handleChange}
                                >
                                    <option value="">Select Traditional Theme</option>
                                    <option value="Classic">Classic</option>
                                    <option value="Royal">Royal</option>
                                </select>
                            </div>
                        )}
                        {formData.eventType === 'Modern' && (
                            <div>
                                <label>Modern Theme Preference</label>
                                <select
                                    name="weddingTheme.themePreference"
                                    value={formData.weddingTheme.themePreference}
                                    onChange={handleChange}
                                >
                                    <option value="">Select Modern Theme</option>
                                    <option value="Minimalistic">Minimalistic</option>
                                    <option value="Contemporary">Contemporary</option>
                                </select>
                            </div>
                        )}
                        {formData.eventType === 'Destination' && (
                            <div>
                                <label>Destination Theme Preference</label>
                                <select
                                    name="weddingTheme.themePreference"
                                    value={formData.weddingTheme.themePreference}
                                    onChange={handleChange}
                                >
                                    <option value="">Select Destination Theme</option>
                                    <option value="Beach">Beach</option>
                                    <option value="Tropical">Tropical</option>
                                </select>
                            </div>
                        )}

                        <input
                            type="text"
                            name="weddingTheme.colorScheme"
                            value={formData.weddingTheme.colorScheme}
                            onChange={handleChange}
                            placeholder="Color Scheme Preference"
                        />
                        <input
                            type="text"
                            name="weddingTheme.decorStyle"
                            value={formData.weddingTheme.decorStyle}
                            onChange={handleChange}
                            placeholder="Decor Style"
                        />
                    </section>
                )}

                {/* Step 3: Venue Preferences */}
                {step === 3 && (
                    <section className="form-section">
                        <h3>Venue Preferences</h3>
                        <input
                            type="text"
                            name="venueDetails.type"
                            value={formData.venueDetails.type}
                            onChange={handleChange}
                            placeholder="Type of Venue (Indoor, Outdoor, Beach, etc.)"
                        />
                        <input
                            type="text"
                            name="venueDetails.size"
                            value={formData.venueDetails.size}
                            onChange={handleChange}
                            placeholder="Venue Size"
                        />
                        <textarea
                            name="venueDetails.specialRequirements"
                            value={formData.venueDetails.specialRequirements}
                            onChange={handleChange}
                            placeholder="Special Venue Requirements"
                        />
                    </section>
                )}

                {/* Navigation Buttons */}
                <div className="form-navigation">
                    {step > 1 && (
                        <button type="button" onClick={handlePrev}>
                            Previous
                        </button>
                    )}
                    {step < 3 ? (
                        <button type="button" onClick={handleNext}>
                            Next
                        </button>
                    ) : (
                        <button type="submit">Submit</button>
                    )}
                </div>
            </form>
        </div>
    );
};

export default WeddingPlanningForm;
